window.bookSummaryJSON = "<p><b>Get the Captain Quasar boxset, featuring all three hilarious books in this romp through space and time. Perfect for fans of </b><b><i>Galaxy Quest</i></b><b>, </b><b><i>Guardians of the Galaxy</i></b><b>, and </b><b><i>Hitchhiker's Guide to the Galaxy</i></b><b>.</b></p> <p>Captain Quasar is out of time.</p> <p>Pursued by vengeful Goobalob toll collectors, savage Arachnoid bounty hunters, and formidable Amazonians, Captain Bartholomew Quasar must do whatever he can to keep the crew of the <i>Effervescent Magnitude</i> out of harm's way.</p> <p>All in a day's work - except time is not on his side.</p> <p>Torn from the present to relive his past, he vows to keep mistakes from occurring the second time around. But is he doomed to repeat history? Or can he erase his regrets?</p> <p><b>Villains will be vanquished. Lives will be lost. Bonds will be betrayed. Heroes will be heroic. Join the crew of the </b><b><i>Effervescent Magnitude</i></b><b> in this special edition omnibus for a side-splitting time-travel space adventure, the likes of which you've never seen!</b></p>"; 
